import React from 'react';
import './App.css';
import {testAC} from "./test-reducer";
import {connect} from "react-redux";

const mapDispatchToProps = dispatch => (
    {
        test(test) {
            dispatch(testAC(test))
        }
    }
)

function App({test}) {
    test('blya rabotai')
  return (
    <div className="App">
        test
    </div>
  );
}
export default connect(null,mapDispatchToProps)(App)
